import React, { useState } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Link } from "react-router-dom";
import "./style.module.css";

function Nav() {
  return (
    <nav>
      <Router>
        <Link to="/">
          <h3>Home</h3>
        </Link>
        <Link to="/about">
          <h3>About</h3>
        </Link>
        <Link to="/test">
          <h3>Test</h3>
        </Link>
      </Router>
    </nav>
  );
}

export default Nav;
